import React, { Component } from 'react';
import _ from 'lodash';

export default class View extends Component {

    constructor(props) {
        super(props)
    
    }

    componentWillMount(){

        const {match} = this.props;

        console.log('ID of post is : ', _.get(match, 'params.id'));
    }
    

    render() {
        return (
            <div>
                Here is the download View
            </div>
        )
    }
}
